    const {data,loading} = useFetchData("http://localhost:3004/api/blog")
    const navigate = useNavigate()
    const handleNavigate = (page)=>{
        navigate(page)
    }
  return (
    <div className='px-24 text-black'>
        <div className='flex py-16 justify-between'>
